import React from 'react'
import {ThemeProvider,createMuiTheme, makeStyles} from '@material-ui/core'


const theme = createMuiTheme({
  palette: {
    type: 'dark',
    primary:{
      // light:"#a6d4fa",
      main:"#90caf9",
      // dark:"#648dae"
    },
    secondary:{
      main:"#f48fb1"
    },
    background:{
      // default:"#121212",
      // paper:"#303030"
    },
    
  },
});

export default function ChannelInfo(){


	return (
		<React.Fragment>
			<ThemeProvider theme={theme}>
			</ThemeProvider>
		</React.Fragment>
		)
}
